const persons = [
  {
    name: "Geo",
    age: 18,
    Hobbies: ["sports", "music"],
  },
  // {
  //   name: "Tom",
  //   age: 25,
  //   Hobbies: ["movie", "music"],
  // },
  // {
  //   name: "Lisa",
  //   age: 21,
