  // },
];

const Example = () => {
  return (
    <>
      <ul>
        {/* {persons.map((person) => (
          <Profile {...person}/>
      ))} */}
        {/* <Profile { ...persons}/> */}
        {/* <Profile name="Geo" age="18" hobbies={["sports", "music"]}/> */}
